    <script type="text/javascript">
    var tmp = new Date();
    function fn() {
        console.log(tmp);
        if (false) {
            var tmp = "hello world";//声明提升(hosting),var tmp提前了 , 但是没有赋值
        }
    }
    fn(); // undefined


    // 'use strict'
    function f(){
        console.log('outside');
    }
    (function(){
        console.log(f);//undefined
        if(false){
            function f(){
                console.log('inside');
            }
        }
        f();//报错 f不是函数 按照常理来说函数声明提前应该连函数体也会提前
    })();

    </script>
